    const fetch = async () => {
      try {
        const { data } = await axios.get(`http://127.0.0.1:8000/api/profile/${id}/`);
        setNotes(data);
      } catch (err) {
        console.error(err);
      }
    };
    fetch();
  }, []);

  return (
    <div>
